column132:
No. Pointing a weapon at a civilian is not one of the forms of physical force required to be reported. "Any officer who uses deadly force, or witnesses another officer use deadly force, will immediately contact his or her supervisor." (Use of Deadly Force, 600-018). Also, "[o]fficers who use force on a subject will contact their supervisor immediately...An IACMS investigation is also required when no apparent use of force has occurred, but a subject has sustained visible injuries while fleeing from police or while in custody. These injuries are categorized as No Force Subject Injury (NFSI) investigations in the IACMS. Examples include:
  a. A subject fleeing from arrest and injures himself;
  b. A subject injures himself in any manner while handcuffed or in police custody." (Use of Less Lethal Force, 600-019)

column124:
Yes. PROHIBITED USE OF CHOKE HOLDS. Officers are prohibited from using the following control holds:
 a. Carotid restraint;
 b. Choke hold--choking by means of pressure to the subjects trachea or other means that prevent breathing.

column132:
No. Does not require reporting of threats of force such as pointing a firearm at a civilian.
 Use of force incidents to be reported shall include but are not limited to:
  1. Whenever an employee discharges a firearm, other than for training, or legal recreational purposes;
  2. Whenever an employee takes an action that results in (or is alleged to have resulted in) injury or death of another person;
  3. When force is applied through the use of less lethal weapons, CE devices, chemical spray, baton, etc.; and/or
  4. Whenever an employee uses defensive or physical force other than soft empty-hand control.

