column132:
Yes. "B. Members will fill out Response to Resistance Form and the Electronic Use of Force/Restraint Evaluation Form whenever the following situations occur: 
 l . Displaying a police weapon as a means to gain compliance. This would include aerosol weapon, baton, Taser, handgun, shotgun, or rifle. Each member who engages in the activity will fill out the form; 
 2. Discharging a police weapon to accomplish a police objective. This would include using an aerosol weapon on an individual, striking a person with a baton, easing a suspect, or shooting a duty handgun, shotgun, or rifle. Each member who engages in the activity will fill out the form;
 3. A member uses physical force. Each member who engages in the activity will fill out the form;
 4. A member handcuffs a person for "officer safety" reasons only. Each member who engages in the activity will fill out the form. (Members may handcuff individuals when the member reasonably believes it is necessary to prevent injury to himself/herself or others [302.06 Al.)
 5. Whenever directed by a supervisor."

column134:
No. Police Department Policy Manual does not require officers to exhaust all other reasonable means before resorting to deadly force.
"IT IS THE POLICY OF THE GARDEN GROVE POLICE DEPARTMENT THAT OFFICERS MAY USE DEADLY FORCE ONLY AFTER THE OFFICER REASONABLY BELIEVES THAT THE FORCE USED IS NECESSARY TO ACCOMPLISH LAWFUL OBJECTIVES: 
1. IN DEFENSE OF HUMAN LIFE, INCLUDING THE OFFICER'S OWN;
2. IN DEFENSE OF ANY PERSON IN IMMINENT DANGER OF DEATH, OR THE IMMINENT THREAT OF SERIOUS PHYSICAL INJURY;
3. THE USE OF DEADLY FORCE AGAINST A SUSPECTED FLEEING FELON MAY ONLY BE USED IN DEFENSE OF HUMAN LIFE, INCLUDING THE OFFICER'S OWN; OR IN DEFENSE OF ANY PERSON IN IMMINENT DANGER OF DEATH OR THE IMMINENT THREAT OF SERIOUS PHYSICAL INJURY."
